import React, { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("http://localhost:3001/api/todos");
      const todos = await response.json();
      setData(todos);
    };
    fetchData();
  }, []);
  data.toString();

  return <div></div>;
}

export default App;
